import React, { useState } from 'react';
import SquareButton from '../../components/Buttons/SquareButton';
import "./main_style.css"

const gen_img = require('./planta.jpg')
interface Params{
    boton1_action: ()=>void[]
    boton2_action: ()=>void
    boton3_action: ()=>void
    boton4_action: ()=>void
}

function Main({boton1_action,boton2_action,boton3_action,boton4_action}:Params){

    return <div className='main-page'>
        <SquareButton img_src={gen_img} title={"First button"} on_click_action={boton1_action}></SquareButton>
        <SquareButton img_src={gen_img} title={"Second button"} on_click_action={boton2_action}></SquareButton>
        <SquareButton img_src={gen_img} title={"Third button"} on_click_action={boton3_action}></SquareButton>
        <SquareButton img_src={gen_img} title={"Forth button"} on_click_action={boton4_action}></SquareButton>
    </div>
}

export default Main;
